import { NavLink } from "react-bootstrap";
const Index = (props) => {
  return (
    <>
      <NavLink
        to={
          props.TitleLink ? (
            props.TitleLink
          ) : (
            <span>
              {props.TilelIcon}
              {props.Name}
            </span>
          )
        }
        className="profil_emp_inter_page_title finance_inter_page_title"
      >
        {props.TilelIcon}
        {props.Name}
      </NavLink>
    </>
  );
};
export default Index;
